import React, { Component } from 'react';
import {
  Grid,
  Row,
  Col,
} from 'react-bootstrap';
class Timeslots extends Component {
  render() {
    return (

    <Grid>
      <Row className="timeslot">
        <Col xs={4} md={1}>
          {'10:00am - 10:30am'}
        </Col>
        <br></br>
        <Col xs={4} md={1}>
         {'10:30am - 11:00am'}
        </Col>
        <br></br>
        <Col xs={4} md={1}>
          {'10:00am - 10:30am'}
        </Col>
        <br></br>
        <Col xs={4} md={1}>
          {'10:00am - 10:30am'}
        </Col>
        <br></br>
        <Col xs={4} md={1}>
         {'10:00am - 10:30am'}
        </Col>
        <br></br>
        <Col xs={4} md={1}>
         {'10:00am - 10:30am'}
        </Col>
        <br></br>
        <Col xs={4} md={1}>
         {'10:00am - 10:30am'}
        </Col>
        <br></br>
      </Row>

     <Row className="show-grid">
        <Col xs={4} md={1}>
          {'10:00am - 10:30am'}
        </Col>
        <Col xs={4} md={1}>
         {'10:00am - 10:30am'}
        </Col>
        <Col xs={4} md={1}>
          {'10:00am - 10:30am'}
        </Col>
        <Col xs={4} md={1}>
          {'10:00am - 10:30am'}
        </Col>
        <Col xs={4} md={1}>
         {'10:00am - 10:30am'}
        </Col>
        <Col xs={4} md={1}>
          {'10:00am - 10:30am'}
        </Col>
        <Col xs={4} md={1}>
          {'10:00am - 10:30am'}
        </Col>
       </Row>

      <Row className="show-grid">
        <Col xs={4} md={1}>
          {'10:00am - 10:30am'}
        </Col>
        <Col xs={4} md={1}>
         {'10:00am - 10:30am'}
        </Col>
        <Col xs={4} md={1}>
          {'10:00am - 10:30am'}
        </Col>
        <Col xs={4} md={1}>
          {'10:00am - 10:30am'}
        </Col>
        <Col xs={4} md={1}>
         {'10:00am - 10:30am'}
        </Col>
        <Col xs={4} md={1}>
         {'10:00am - 10:30am'}
        </Col>
        <Col xs={4} md={1}>
          {'10:00am - 10:30am'}
        </Col>
      </Row>

      <Row className="show-grid">
        <Col xs={4} md={1}>
          {'10:00am - 10:30am'}
        </Col>
        <Col xs={4} md={1}>
         {'10:00am - 10:30am'}
        </Col>
        <Col xs={4} md={1}>
          {'10:00am - 10:30am'}
        </Col>
        <Col xs={4} md={1}>
          {'10:00am - 10:30am'}
        </Col>
        <Col xs={4} md={1}>
         {'10:00am - 10:30am'}
        </Col>
        <Col xs={4} md={1}>
          {'10:00am - 10:30am'}
        </Col>
        <Col xs={4} md={1}>
          {'10:00am - 10:30am'}
        </Col>
      </Row>
    </Grid>
    );
  }
}

export default Timeslots;
